    "What's going on?": "Was ist los?",
    "Global staff cannot make Help requests. This form is only for reference.": "Der globale Staff kann keine Hilfeanfragen erstellen. Dieses Formular dient lediglich zu informativen Zwecken.",
    "Abuse of Help requests can result in punishments.": "Der Missbrauch von Hilfeanfragen kann zu Strafen f\xFChren.",
    "What do you want to report someone for?": "Aus welchem Grund m\xF6chtest du jemanden melden?",
    "If someone is harassing you in private messages (PMs), click the button below and a global staff member will take a look. If you are being harassed in a chatroom, please ask a room staff member to handle it. If it's a minor issue, consider using <code>/ignore [username]</code> instead.": "Falls dich jemand in einer privaten Nachricht bel\xE4stigt, klicke unten auf die Schaltfl\xE4che und ein globales Staffmitglied wird sich um den Fall k\xFCmmern. Falls du in einem Chatraum bel\xE4stigt wirst, wende dich an ein Staffmitglied des jeweiligen Raumes. Falls es sich um nichts Ernstes handelt, kannst du mit <code>/ignore [Nutzername]</code> den jeweiligen User ignorieren.",
    "If someone is harassing you in a battle, click the button below and a global staff member will take a look. If you are being harassed in a chatroom, please ask a room staff member to handle it. If it's a minor issue, consider using <code>/ignore [username]</code> instead.": "Falls dich jemand in einem Kampf bel\xE4stigt, klicke unten auf die Schaltfl\xE4che und ein globales Staffmitglied wird sich um den Fall k\xFCmmern. Falls du in einem Chatraum bel\xE4stigt wirst, wende dich an ein Staffmitglied des jeweiligen Raumes. Falls es sich um nichts Ernstes handelt, kannst du mit <code>/ignore [Nutzername]</code> den jeweiligen User ignorieren.",
    "Please save a replay of the battle if it has ended, or provide a link to the battle if it is still ongoing.": "Bitte speichere ein Replay des Kampfes, falls dieser bereits vorbei ist, oder schicke uns einen Link zum Kampf, falls dieser noch andauert.",
    "If a user has an inappropriate name, click the button below and a global staff member will take a look.": "Falls ein User einen unangemessenen Namen hat, klicke unten auf die Schaltfl\xE4che und ein globales Staffmitglied wird sich um den Fall k\xFCmmern.",
    "If a user has inappropriate Pokemon nicknames, click the button below and a global staff member will take a look.": "Falls ein User Pokemon mit unangemessenen Spitznamen hat, klicke unten auf die Schaltfl\xE4che und ein globales Staffmitglied wird sich um den Fall k\xFCmmern.",
    "What would you like to appeal?": "Gegen welche Entscheidung m\xF6chtest du Widerspruch einlegen?",
    "Permalocks are usually for repeated incidents of poor behavior over an extended period of time, and rarely for a single severe infraction. Please keep this in mind when appealing a permalock.": "Permalocks werden gew\xF6hnlich an User ausgestellt, welche sich wiederholt regelwidrig \xFCber einen l\xE4ngeren Zeitraum verhalten haben, und nur in Ausnahmef\xE4llen f\xFCr ein einzelnes schweres Vergehen. Bitte beachte das, wenn du einen Permalock anfechten m\xF6chtest.",
    'Please visit the <a href="https://www.smogon.com/forums/threads/discipline-appeal-rules.3583479/">Discipline Appeals</a> page to appeal your permalock.': 'Bitte besuche die <a href="https://www.smogon.com/forums/threads/discipline-appeal-rules.3583479/">Discipline Appeals</a> Seite, um einen Permalock anzufechten.',
    "If you want to appeal your lock or namelock, click the button below and a global staff member will be with you shortly.": "Falls du gegen deinen Lock oder Namelock Widerspruch einlegen m\xF6chtest, klicke unten auf die Schaltfl\xE4che und ein globales Staffmitglied wird gleich da sein.",
    "If you are locked or namelocked under a name you don't recognize, click the button below to call a global staff member so we can check.": "Falls du unter einem Namen, den du nicht kennst, einen Lock oder Namelock erhalten hast, klicke unten auf die Schaltfl\xE4che, um ein globales Staffmitglied zu benachrichtigen, damit wir dies \xFCberpr\xFCfen k\xF6nnen.",
    "We automatically lock proxies and VPNs to prevent evasion of punishments and other attacks on our server. To get unlocked, you need to disable your proxy or VPN.": "Wir stellen automatisch Locks f\xFCr das Benutzen von Proxy-Servern und VPNs aus, um zu verhindern, dass Strafen umgangen und andere Attacken auf unseren Server begangen werden.",
    "Do you have an autoconfirmed account? An account is autoconfirmed when it has won at least one rated battle and has been registered for one week or longer.": "Besitzt du einen Account, welcher autoconfirmed ist? Ein Account ist dann autoconfirmed, wenn dieser mindestens einen Ladder-Kampf gewonnen hat und seit einer Woche oder l\xE4nger registriert ist.",
    "Login to your autoconfirmed account by using the <code>/nick</code> command in any chatroom, and the semilock will automatically be removed. Afterwards, you can use the <code>/nick</code> command to switch back to your current username without being semilocked again.": "Melde dich mit deinem Autoconfirmed-Account an, indem du den Befehl <code>/nick</code> in einen Chatraum eingibst und der Semilock wird automatisch entfernt. Danach kannst du den Befehl <code>/nick</code> benutzen, um zu deinem derzeitigen Nutzernamen zur\xFCckzuwechseln, ohne wieder einen Semilock zu erhalten.",
    "If the semilock does not go away, you can try asking a global staff member for help. Click the button below to call a global staff member.": "Falls der Semilock nicht verschwindet, kannst du ein globales Staffmitglied um Hilfe bitten. Klicke unten auf die Schaltfl\xE4che, um ein globales Staffmitglied zu benachrichtigen.",
    "If you don't have an autoconfirmed account, you will need to contact a global staff member to appeal your semilock. Click the button below to call a global staff member.": "Falls du keinen Account besitzt, welcher autoconfirmed ist, musst du ein globales Staffmitglied direkt kontaktieren, um gegen deinen Semilock Einspruch einzulegen. Klicke unten auf die Schaltfl\xE4che, um ein globales Staffmitglied zu benachrichtigen.",
    "Please PM the staff member who punished you. If you don't know who punished you, ask another room staff member; they will redirect you to the correct user. If you are banned or blacklisted from the room, use <code>/roomauth [name of room]</code> to get a list of room staff members. Bold names are online.": "Bitte schicke eine private Nachricht an jenes Staffmitglied, welches dich bestraft hat. Falls du dir nicht sicher bist, wer dich bestraft hat, frage ein anderes Staffmitglied und du wirst an den richtigen User weitergeleitet. Falls du im Raum gebannt oder geblacklistet wurdest, benutze <code>/roomauth [name of room]</code> um eine Liste der Staffmitglieder im jeweiligen Raum zu erhalten. Alle hervorgehobenen Namen sind gerade online.",
    "Do not PM staff if you are locked (signified by the symbol <code>\u203D</code> in front of your username). Locks are a different type of punishment; to appeal a lock, make a help ticket by clicking the Back button and then selecting the most relevant option.": "Bitte schicke keine private Nachricht an ein Staffmitglied, falls du einen Lock erhalten hast (erkennbar am Symbol <code>\u203D</code> vor deinem Nutzernamen). Bei Locks handelt es sich um eine andere Art der Bestrafung; um gegen einen Lock Widerspruch einzulegen, erstelle ein Help-Ticket, indem du auf die Schaltfl\xE4che Zur\xFCck klickst und anschlie\xDFend die entsprechende Option ausw\xE4hlst.",
    "Maybe one of these options will be helpful?": "Vielleicht ist eine dieser Optionen hilfreich?",
